import AuthProvider from "../context/authContext";
import DraftboardContextProvider from "../context/draftboardContext";

function MyApp({ Component, pageProps }) {
  return (
    <AuthProvider>
      <DraftboardContextProvider>
        <Component {...pageProps} />
      </DraftboardContextProvider>
    </AuthProvider>
  );
}

export default MyApp;
